import React from "react";
import Skill from "./Skill.js";
export default class extends React.Component{
    state={
        cards:[{
                key:0,
                title:"Web Development",
                skills:[{key:0,value:"React"},{key:1,value:"SCSS"}],
                pos:{
                    x:0,
                    y:0,
                }
            },
            {
                key:1,
                title:"Personal",
                skills:[{key:0,value:"Loving Jaymee"}],
                pos:{
                    x:0,
                    y:0,
                }
            },
            {
                key:2,
                title:"Anotha One",
                skills:[{key:0,value:["being big op"]}],
                pos:{
                    x:0,
                    y:0,
                }
            },
        ]
    }
    componentDidMount(){
        var rect = document.getElementsByClassName('MuiCard-root');
        console.log(rect);
    }
    render(){


        const myStyle={
            stroke:"rgb(255,255,0)",
            strokeWidth:5,
            zIndex:1,
        }
        const svgStyle={
            position:"absolute",
            backgroundColor:"green",
            opacity:0.4,
            zIndex:1,
            width:"100%", 
            minHeight:"40vh",
        }
        return(
            <>
            <svg style={svgStyle}>
                <line x1="100" y1="0" x2="100" y2="100"
                    style={myStyle}
                />
              </svg>
            <div className="container">
                {this.state.cards.map(x=>(
                    <Skill  title={x.title}
                            skills={x.skills}
                    />
                ))}
            </div>
            </>
        );
    }
}
